import React from 'react';
import RequestReset from '../components/RequestReset';

export default function reset({ query }) {
  if (!query?.token) {
    return (
      <div>
        <p>Sorry you must supply a token</p>
        <RequestReset />
      </div>
    );
  }
  return (
    <div>
      <p>Reset your password</p>
    </div>
  );
}
